window.bookSummaryJSON = "<p>The Second Draeken War has yet to occur, but his victory is assured. When all life stands on the brink the nations will be forced to gather but it will be too late. The army built to exterminate them will not fail in its purpose. Unless the future is altered. Eleven impossible tasks will give the races a singular hope, to defend their lives as one people. Their completion will not be known. Their impact cannot be measured. But even the Oracle cannot do it alone.</p>"; 
